import React from 'react'
import {Link} from "react-router-dom";
import Hero from "../components/Hero";
import { IoIosArrowBack } from "react-icons/io";

export default function store() {
    return (
        <Hero title="SwiftSense" max="true">
          
                <Link to ="/login" className="main-link" style={{ margin: "2rem" }}> 
                    Manager
                </Link>
                <Link to ="/retailer-login" className="main-link" style={{ margin: "2rem" }}> 
                    Retailer
                </Link>

                <Link to ="/" className="main-link" style={{ margin: "2rem" }}>
                    <IoIosArrowBack> Back</IoIosArrowBack>
                </Link>
            
                
        </Hero>
    )
}
